import logo from './logo.svg';
import './App.css';

const blockRand = [
  {
    number: 1,
    color: '#2c88d9',
    position: 'col-6'
  },
  {
    number: 2,
    color: '#d3455b',
    position: 'col-6'
  },
  {
    number: 3,
    color: 'grey',
    position: 'col-6'
  },
  {
    color: 'green',
    position: 'col-6'
  }
]

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="row">
          { blockRand.map((b) => {
            return (
              <div className={b.color + ' ' + b.position}></div>
            )
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
